import React, { Component } from 'react';
import WebDisclaimer from '../components/Legal/WebDisclaimer';

export class Disclaimer extends Component {
    render() {
        return (
            <div>
                <WebDisclaimer/>
            </div>
        )
    }
}

export default Disclaimer
